Másképp értelmezve, azt jelentené, hogy előbb ütsz aztán gondolkodsz.

{{champion:83}} {{item:3072}} 

Jelen esetben előbb inkább kérdezted, minthogy rákerestél volna, még mindig tart az osztás, én sem kaptam  meg, de nem nyitok témát csak ezért, ha mégse kapnám meg, akkor majd írok a játékostámogatásra.
